<h4>ERROR 406: </h4>
<p class="MsoNormal" style="MARGIN-LEFT: 18pt"><b>Could not find Impact Analysis 
&lt;File Name&gt;</b></p>
<p class="t1Text151">Description:</p>
<p class="t2Text2"><span style="FONT-SIZE: 12pt; FONT-FAMILY: 'Times New Roman','serif'">The Impact 
Analysis file name could not be found on the Knowledge Base Server.  
</span></p>
<p class="t1Text151">Resolution:</p>
<p class="t2Text2"><span style="FONT-SIZE: 12pt; FONT-FAMILY: 'Times New Roman','serif'">Verify the 
Impact Analysis report exists on the Knowledge Base Server for the specific 
User.</span></p>
